import { useState, useEffect } from 'react';

export default function AppleCore() {
   const [products, setProducts] = useState([]);

   useEffect(() => {
      fetch('http://localhost:3000/products')
         .then((r) => r.json())
         .then((data) => setProducts(data));
   }, []);

   return products.map((product) => (
      <div>
         <h1>{product.title}</h1>
      </div>
   ));
}
